import React from 'react';


function Playlist({ playlist }) {
  return (
    <div className="container">
      <div className="column">
        <img src={playlist.albumUrl} style={{ height: '100px', width: '100px' }}></img>
        <p>{playlist.name}</p>
        <p>{playlist.description}</p>
      </div>
    </div>
  )
}

export default Playlist;
